import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import StudentList from './StudentList';
import InterviewSelection from './InterviewSelection'; 
import ExportExcel from './ExportExcel';

const StudentManagementForm = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/student-list">Danh Sách Sinh Viên</Link>
            </li>
            <li>
              <Link to="/interview-selection">Chọn Phỏng Vấn</Link>
            </li>
            <li>
              <Link to="/export-excel">Xuất Excel</Link>
            </li>
          </ul>
        </nav>

        <div>
          <Route path="/student_list" element={<StudentList />} />
          <Route path="/interview_selection" element={<InterviewSelection />} />
          <Route path="/export_excel" element={<ExportExcel />} />
        </div>
      </div>
    </Router>
  );
};

export default StudentManagementForm;
